import {MovieInterface} from "../Interface/ResponsesInterfaces";

export default function Movies({movies}: { movies: MovieInterface }) {
    return (
        <div className='bg-light rounded p-3 mb-3'>

            <img src={`../assets/images/films/${movies.affiche}`} />
            <h3>{movies.name}</h3>
            <p>
                <small>
                    Par : {movies.creator}
                    <br/>
                    Le : {movies.published}
                </small>
            </p>
        </div>
    )
}
